# Ambil kunci rahasia buat dekrip (pastikan file kuncinya ada!)
def ambil_kunci(file_kunci):
    with open(file_kunci, "rb") as file:
        return file.read()

# Dekrip sama jalanin kode
kunci = ambil_kunci("kunci_rahasia.key")
fernet = Fernet(kunci)
kode_dekrip = fernet.decrypt(KODE_ENKRIP.encode('utf-8')).decode('utf-8')
exec(kode_dekrip)
